import React from 'react';
import ReactDOM from 'react-dom';

import axios from 'axios';

/* The function, App, is what react calls a Component. It can take a parameter, 
often called props, and has to return a template. This template is similar to the render functions we've used before. */
const App = () => {
  return (
    <div id="app">
      <div id="search">
        <h3>Look up cards here...</h3>
        <form>
          <input type="text" placeholder="card search" />
          <button type="submit">Search</button>
        </form>
      </div>
      <div id="results">
        <h3>Here's what we found:</h3>
      </div>
      <div id="deck">
        <h3>Your deck so far:</h3>
      </div>
    </div>
  );
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
